# - Mesmo app_v2, mas com marketing_campaign.csv dentro do código (base64)
# - Não requer upload; o app já carrega o dataset embutido (pode aceitar upload opcional para substituir)
#
# Como executar localmente:
#   pip install -U streamlit scikit-learn imbalanced-learn pandas numpy matplotlib joblib
