import io, os, sys, time, base64, joblib
import numpy as np
import pandas as pd
import matplotlib.pyplot as plt
import streamlit as st

from typing import Tuple, Dict, Optional
from sklearn.model_selection import train_test_split, StratifiedKFold, cross_val_predict
from sklearn.metrics import (
    accuracy_score, precision_score, recall_score, f1_score, roc_auc_score,
    confusion_matrix, roc_curve, auc, precision_recall_curve, average_precision_score
)
from sklearn.compose import ColumnTransformer
from sklearn.preprocessing import OneHotEncoder, StandardScaler
from sklearn.pipeline import Pipeline
from sklearn.impute import SimpleImputer

from sklearn.linear_model import LogisticRegression
from sklearn.ensemble import RandomForestClassifier, HistGradientBoostingClassifier
from sklearn.calibration import CalibratedClassifierCV

# imblearn (SMOTE)
try:
    from imblearn.pipeline import Pipeline as ImbPipeline
    from imblearn.over_sampling import SMOTE
except Exception:
    ImbPipeline = None
    SMOTE = None

st.set_page_config(page_title="Marketing Campaign — Tarefa 6 (V2 embutido)", layout="wide")
st.title("Marketing Campaign — Classificação (V2, CSV embutido)")
st.caption("Dataset embutido; upload opcional substitui o embutido.")

# =====================
# CSV embutido
# =====================
_csv_b64 = """"""

def load_embedded_df() -> pd.DataFrame:
    data = base64.b64decode(_csv_b64.encode("utf-8"))
    # tenta separadores comuns
    for sep in ["\t", ",", ";"]:
        try:
            df = pd.read_csv(io.BytesIO(data), sep=sep)
            if df.shape[1] > 1:
                break
        except Exception:
            pass
    df.columns = [c.strip().replace(" ", "_") for c in df.columns]
    return df

# =====================
# Utilitários
# =====================

YES_NO_MAP = {
    "yes": 1, "sim": 1, "y": 1, "true": 1, "1": 1,
    "no": 0, "não": 0, "nao": 0, "n": 0, "false": 0, "0": 0
}

def detect_separator(binary: bytes) -> str:
    import pandas as _pd, io as _io
    for sep in ["\t", ",", ";"]:
        try:
            _pd.read_csv(_io.BytesIO(binary), sep=sep, nrows=5)
            return sep
        except Exception:
            continue
    return ","

def load_dataset() -> pd.DataFrame:
    uploaded = st.file_uploader("Envie outro CSV (opcional, substitui o embutido)", type=["csv"])
    if uploaded is not None:
        content = uploaded.read()
        sep = detect_separator(content)
        df = pd.read_csv(io.BytesIO(content), sep=sep)
        st.success(f"CSV enviado detectado (sep='{{sep}}') — substituindo o embutido.")
    else:
        df = load_embedded_df()
        st.info("Usando dataset embutido no app (sem necessidade de upload).")
    df.columns = [c.strip().replace(" ", "_") for c in df.columns]
    return df

def pick_target(df: pd.DataFrame) -> str:
    preferred = [c for c in ["Complain", "complain", "Response", "response"] if c in df.columns]
    bin_like = preferred[:]
    for c in df.columns:
        if c in preferred: 
            continue
        s = df[c]
        if s.dropna().nunique() == 2:
            bin_like.append(c)
    return st.selectbox("Escolha a variável-alvo (binária de preferência)", bin_like or list(df.columns))

def coerce_target_to_binary(series: pd.Series) -> Tuple[pd.Series, Optional[str]]:
    if pd.api.types.is_numeric_dtype(series):
        uniq = sorted(series.dropna().unique().tolist())
        if set(uniq).issubset({0,1}):
            return series.astype(int), None
        if len(uniq) == 2:
            m = {uniq[0]:0, uniq[1]:1}
            return series.map(m).astype(int), f"Mapeamento numérico aplicado: {{m}}"
        return series.astype(int), "Coluna numérica convertida para inteiros (verifique se representa 0/1)."
    mapped = series.astype(str).str.strip().str.lower().map(YES_NO_MAP)
    if mapped.notna().any() and mapped.isna().mean() < 0.5:
        mode = int(mapped.dropna().mode().iloc[0])
        mapped = mapped.fillna(mode).astype(int)
        return mapped, "Alvo textual mapeado via yes/no (faltantes preenchidos com o modo)."
    vals = series.astype(str).fillna("NA").values
    uniq = pd.Series(vals).value_counts().index.tolist()
    if len(uniq) == 2:
        m = {uniq[0]:0, uniq[1]:1}
        return pd.Series(vals).map(m).astype(int), f"Alvo categórico com 2 níveis mapeado: {{m}}"
    st.error("A coluna-alvo não é binária nem numérica 0/1 reconhecível. Ajuste-a manualmente.")
    st.stop()

def build_preprocess(X: pd.DataFrame):
    num_cols = X.select_dtypes(include=[np.number]).columns.tolist()
    cat_cols = X.select_dtypes(exclude=[np.number]).columns.tolist()
    numeric_pipe = Pipeline([("imputer", SimpleImputer(strategy="median")), ("scaler", StandardScaler())])
    categorical_pipe = Pipeline([("imputer", SimpleImputer(strategy="most_frequent")), ("onehot", OneHotEncoder(handle_unknown="ignore", sparse_output=False))])
    preprocess = ColumnTransformer([("num", numeric_pipe, num_cols), ("cat", categorical_pipe, cat_cols)], remainder="drop")
    return preprocess, num_cols, cat_cols

def make_pipeline(model, preprocess, use_smote: bool, random_state: int):
    if use_smote and (SMOTE is not None) and (ImbPipeline is not None):
        return ImbPipeline([("preprocess", preprocess), ("smote", SMOTE(random_state=random_state)), ("clf", model)])
    else:
        return Pipeline([("preprocess", preprocess), ("clf", model)])

def metrics_from_proba(y_true, proba, threshold=0.5):
    y_pred = (proba >= threshold).astype(int)
    out = {
        "Accuracy": accuracy_score(y_true, y_pred),
        "Precision": precision_score(y_true, y_pred, zero_division=0),
        "Recall": recall_score(y_true, y_pred, zero_division=0),
        "F1": f1_score(y_true, y_pred, zero_division=0),
        "ROC_AUC": roc_auc_score(y_true, proba) if len(np.unique(y_true))==2 else np.nan,
        "PR_AUC": average_precision_score(y_true, proba),
    }
    return out

def choose_threshold_by_fbeta(y_true, proba, beta=1.0):
    prec, rec, thr = precision_recall_curve(y_true, proba)
    prec, rec = prec[:-1], rec[:-1]
    fb = (1+beta**2)*(prec*rec)/(beta**2*prec + rec + 1e-12)
    idx = int(np.nanargmax(fb))
    return float(thr[idx]), float(fb[idx])

def plot_roc(y_true, proba):
    fpr, tpr, _ = roc_curve(y_true, proba)
    roc_auc = auc(fpr, tpr)
    fig, ax = plt.subplots()
    ax.plot(fpr, tpr, lw=2, label=f"AUC = {roc_auc:.3f}")
    ax.plot([0,1],[0,1], lw=1, linestyle="--")
    ax.set_xlabel("FPR"); ax.set_ylabel("TPR"); ax.set_title("Curva ROC"); ax.legend(loc="lower right")
    return fig

def plot_pr(y_true, proba):
    prec, rec, _ = precision_recall_curve(y_true, proba)
    ap = average_precision_score(y_true, proba)
    fig, ax = plt.subplots()
    ax.plot(rec, prec, lw=2, label=f"AP = {ap:.3f}")
    ax.set_xlabel("Recall"); ax.set_ylabel("Precision"); ax.set_title("Curva Precisão-Recall")
    ax.legend(loc="lower left")
    return fig

def plot_cm(y_true, proba, threshold):
    y_pred = (proba >= threshold).astype(int)
    cm = confusion_matrix(y_true, y_pred)
    fig, ax = plt.subplots()
    im = ax.imshow(cm, interpolation="nearest")
    ax.set_title("Matriz de Confusão")
    ax.set_xlabel("Predito"); ax.set_ylabel("Verdadeiro")
    for (i,j), v in np.ndenumerate(cm):
        ax.text(j, i, str(v), ha="center", va="center")
    return fig

def export_png(fig, path):
    try:
        fig.savefig(path, dpi=140, bbox_inches="tight")
        return True
    except Exception:
        return False

# =====================
# 1) Dados / Alvo
# =====================
df = load_dataset()

with st.expander("Pré-visualização dos dados"):
    st.dataframe(df.head())

to_drop = [c for c in ["ID","Dt_Customer"] if c in df.columns]
if to_drop:
    df = df.drop(columns=to_drop)

if "Age" not in df.columns and "Year_Birth" in df.columns:
    df["Age"] = 2015 - df["Year_Birth"]

target = pick_target(df)
note = None
y_raw = df[target]
y, note = coerce_target_to_binary(y_raw)
if note: st.info(note)

X = df.drop(columns=[target])
preprocess, num_cols, cat_cols = build_preprocess(X)

st.write("**Numéricas:**", num_cols)
st.write("**Categóricas:**", cat_cols)

# =====================
# 2) Parâmetros
# =====================
st.sidebar.header("Parâmetros")
test_size = st.sidebar.slider("Tamanho do teste", 0.1, 0.4, value=0.2, step=0.05)
random_state = st.sidebar.number_input("random_state", value=42, step=1)
balance_mode = st.sidebar.selectbox("Desbalanceamento", ["Nenhum", "class_weight='balanced'", "SMOTE"], index=0)
beta = st.sidebar.slider("β para Fβ", 0.5, 2.0, value=1.0, step=0.1)
calibrate = st.sidebar.checkbox("Calibrar probabilidades (CV=3)", value=False)
cal_method = st.sidebar.selectbox("Método de calibração", ["sigmoid", "isotonic"], index=0, disabled=not calibrate)

class_weight = None
use_smote = (balance_mode == "SMOTE")
if balance_mode == "class_weight='balanced'":
    class_weight = "balanced"

models = {
    "LogReg": LogisticRegression(solver="liblinear", class_weight=class_weight, random_state=int(random_state)),
    "RandomForest": RandomForestClassifier(n_estimators=300, random_state=int(random_state), n_jobs=-1, class_weight=class_weight if class_weight=="balanced" else None),
    "HistGB": HistGradientBoostingClassifier(random_state=int(random_state))
}

if calibrate:
    st.sidebar.info("A calibração será aplicada ao modelo ativo (aba Modelagem). Na Comparação, métricas sem calibração.")

tab1, tab2, tab3 = st.tabs(["Modelagem", "Comparação de Modelos", "EDA"])

with tab1:
    st.subheader("Treino / Avaliação com threshold por Fβ")

    X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=float(test_size), random_state=int(random_state), stratify=y)

    model_name = st.selectbox("Escolha o modelo", list(models.keys()))
    base_model = models[model_name]
    pipe = make_pipeline(base_model, preprocess, use_smote=use_smote, random_state=int(random_state))

    st.write("Gerando probabilidades OOF (StratifiedKFold=5)...")
    cv = StratifiedKFold(n_splits=5, shuffle=True, random_state=int(random_state))
    oof_proba = cross_val_predict(pipe, X_train, y_train, cv=cv, method="predict_proba")[:,1]

    pipe.fit(X_train, y_train)

    if calibrate:
        calib = CalibratedClassifierCV(pipe, method=cal_method, cv=3)
        calib.fit(X_train, y_train)
        model_infer = calib
    else:
        model_infer = pipe

    y_proba_test = model_infer.predict_proba(X_test)[:,1]

    thr_opt, fbeta_best = choose_threshold_by_fbeta(y_train.values, oof_proba, beta=float(beta))
    st.success(f"Threshold ótimo por Fβ (β={beta:.2f}) nos OOF: **{thr_opt:.3f}** (Fβ={fbeta_best:.3f})")

    met_oof = metrics_from_proba(y_train.values, oof_proba, threshold=thr_opt)
    met_test = metrics_from_proba(y_test.values, y_proba_test, threshold=thr_opt)

    colA, colB = st.columns(2)
    with colA:
        st.markdown("**Métricas (OOF / treino via CV)**")
        st.dataframe(pd.DataFrame([met_oof], index=["OOF"]).T)
    with colB:
        st.markdown("**Métricas (Teste holdout)**")
        st.dataframe(pd.DataFrame([met_test], index=["Teste"]).T)

    col1, col2 = st.columns(2)
    with col1:
        fig_roc = plot_roc(y_test.values, y_proba_test); st.pyplot(fig_roc)
    with col2:
        fig_pr = plot_pr(y_test.values, y_proba_test); st.pyplot(fig_pr)

    fig_cm = plot_cm(y_test.values, y_proba_test, thr_opt); st.pyplot(fig_cm)

    st.subheader("Exportáveis")
    pred = pd.DataFrame({"y_true": y_test.values, "y_proba": y_proba_test, "y_pred": (y_proba_test >= thr_opt).astype(int)})
    st.download_button("Baixar predições (teste).csv", pred.to_csv(index=False).encode("utf-8"), file_name="predicoes_teste.csv")

    os.makedirs("export", exist_ok=True)
    for fig, name in [(fig_roc,"roc.png"), (fig_pr,"pr.png"), (fig_cm,"matriz_confusao.png")]:
        try:
            fig.savefig(os.path.join("export", name), dpi=140, bbox_inches="tight")
        except Exception:
            pass
    for name in ["roc.png","pr.png","matriz_confusao.png"]:
        p = os.path.join("export", name)
        if os.path.exists(p):
            with open(p,"rb") as f:
                st.download_button(f"Baixar {name}", f, file_name=name)

    try:
        joblib.dump(model_infer, "export/modelo.pkl")
        with open("export/modelo.pkl","rb") as f:
            st.download_button("Baixar modelo.pkl (pipeline completo)", f, file_name="modelo.pkl")
    except Exception as e:
        st.warning(f"Não foi possível salvar o modelo: {e}")

with tab2:
    st.subheader("Comparação de Modelos (sem calibração)")
    X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=float(test_size), random_state=int(random_state), stratify=y)

    rows = []
    for name, mdl in models.items():
        pipe_cmp = make_pipeline(mdl, preprocess, use_smote=use_smote, random_state=int(random_state))
        cv = StratifiedKFold(n_splits=5, shuffle=True, random_state=int(random_state))
        oof = cross_val_predict(pipe_cmp, X_train, y_train, cv=cv, method="predict_proba")[:,1]
        prec, rec, thr = precision_recall_curve(y_train.values, oof)
        prec, rec = prec[:-1], rec[:-1]
        fb = (1+beta**2)*(prec*rec)/(beta**2*prec + rec + 1e-12)
        thr_star = float(thr[int(np.nanargmax(fb))])
        pipe_cmp.fit(X_train, y_train)
        proba = pipe_cmp.predict_proba(X_test)[:,1]
        met = metrics_from_proba(y_test.values, proba, threshold=thr_star)
        rows.append({"Modelo": name, "Threshold*": round(thr_star,3), **{k: round(v,3) for k,v in met.items()}})

    df_cmp = pd.DataFrame(rows).set_index("Modelo")
    st.dataframe(df_cmp)
    st.caption("Threshold*: escolhido maximizando Fβ (OOF) para cada modelo.")

with tab3:
    st.subheader("Exploração dos Dados")
    numeric_cols = X.select_dtypes(include=[np.number]).columns.tolist()
    catg_cols = X.select_dtypes(exclude=[np.number]).columns.tolist()

    st.markdown("**Distribuições numéricas (histogramas)**")
    sel_num = st.multiselect("Selecione até 3 numéricas", numeric_cols[:3], max_selections=3)
    c = st.columns(3)
    for i, col in enumerate(sel_num[:3]):
        with c[i]:
            fig, ax = plt.subplots()
            ax.hist(X[col].dropna(), bins=30)
            ax.set_title(col)
            st.pyplot(fig)

    st.markdown("**Taxa do alvo por categoria**")
    if catg_cols:
        cat_col = st.selectbox("Escolha uma categórica", catg_cols)
        rates = X.join(y.rename("target")).groupby(cat_col)["target"].mean().sort_values(ascending=False)
        fig, ax = plt.subplots()
        rates.plot(kind="bar", ax=ax)
        ax.set_ylabel("Taxa média do alvo")
        ax.set_title(f"Taxa do alvo por {{cat_col}}")
        st.pyplot(fig)
    else:
        st.info("Não há colunas categóricas detectadas.")

st.success("V2 (embutido) pronta. Sem upload obrigatório; ajuste parâmetros na barra lateral.")
